import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import styled from 'styled-components';
import { FiPlus, FiMap, FiMapPin } from 'react-icons/fi';
import { theme } from '../../styles/theme';
import { Card, Button, Badge } from '../../styles/GlobalStyles';
import { Route } from '../../types';
import { mockAPI } from '../../services/mockData';

const RoutesContainer = styled.div`
  display: flex;
  flex-direction: column;
  gap: ${theme.spacing.xl};
`;

const PageHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const PageTitle = styled.h1`
  font-size: ${theme.typography.fontSize['3xl']};
  font-weight: ${theme.typography.fontWeight.bold};
  color: ${theme.colors.textPrimary};
  margin: 0;
`;

const RoutesList = styled.div`
  display: flex;
  flex-direction: column;
  gap: ${theme.spacing.lg};
`;

const RouteCard = styled(Card)`
  display: flex;
  flex-direction: column;
  gap: ${theme.spacing.md};
`;

const RouteHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: flex-start;
`;

const RouteInfo = styled.div`
  flex: 1;
`;

const RouteName = styled.h3`
  font-size: ${theme.typography.fontSize.lg};
  font-weight: ${theme.typography.fontWeight.semibold};
  color: ${theme.colors.textPrimary};
  margin: 0 0 ${theme.spacing.xs} 0;
`;

const RouteDescription = styled.div`
  color: ${theme.colors.textSecondary};
  font-size: ${theme.typography.fontSize.sm};
`;

const RouteDetails = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
  gap: ${theme.spacing.lg};
  margin-top: ${theme.spacing.md};
`;

const DetailSection = styled.div`
  display: flex;
  flex-direction: column;
  gap: ${theme.spacing.sm};
`;

const DetailLabel = styled.span`
  font-size: ${theme.typography.fontSize.xs};
  color: ${theme.colors.textMuted};
  text-transform: uppercase;
  letter-spacing: 0.05em;
`;

const LocationItem = styled.div`
  display: flex;
  align-items: center;
  gap: ${theme.spacing.sm};
  color: ${theme.colors.textPrimary};
  font-size: ${theme.typography.fontSize.sm};
`;

const Routes: React.FC = () => {
  const navigate = useNavigate();
  const [routes, setRoutes] = useState<Route[]>([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const loadRoutes = async () => {
      try {
        const routesData = await mockAPI.getRoutes();
        setRoutes(routesData);
      } catch (error) {
        console.error('Error loading routes:', error);
      } finally {
        setLoading(false);
      }
    };

    loadRoutes();
  }, []);

  if (loading) {
    return <div>Loading routes...</div>;
  }

  return (
    <RoutesContainer className="fade-in">
      <PageHeader>
        <PageTitle>Routes</PageTitle>
        <Button variant="primary" onClick={() => navigate('/routes/create')}>
          <FiPlus />
          Create Route
        </Button>
      </PageHeader>

      <RoutesList>
        {routes.map((route) => (
          <RouteCard key={route.id}>
            <RouteHeader>
              <RouteInfo>
                <RouteName>{route.name}</RouteName>
                <RouteDescription>{route.description}</RouteDescription>
              </RouteInfo>
              <Badge variant={route.status === 'active' ? 'success' : 'error'}>
                {route.status}
              </Badge>
            </RouteHeader>

            <RouteDetails>
              <DetailSection>
                <DetailLabel>Start Location</DetailLabel>
                <LocationItem>
                  <FiMapPin size={16} color={theme.colors.success} />
                  {route.startLocation.address}
                </LocationItem>
              </DetailSection>

              <DetailSection>
                <DetailLabel>End Location</DetailLabel>
                <LocationItem>
                  <FiMapPin size={16} color={theme.colors.error} />
                  {route.endLocation.address}
                </LocationItem>
              </DetailSection>

              <DetailSection>
                <DetailLabel>Distance</DetailLabel>
                <LocationItem>
                  <FiMap size={16} color={theme.colors.primary} />
                  {route.estimatedDistance} km
                </LocationItem>
              </DetailSection>

              <DetailSection>
                <DetailLabel>Duration</DetailLabel>
                <LocationItem>
                  ⏱️ {route.estimatedDuration} minutes
                </LocationItem>
              </DetailSection>
            </RouteDetails>
          </RouteCard>
        ))}
      </RoutesList>
    </RoutesContainer>
  );
};

export default Routes;
